import React from 'react';
import ReactDOM from 'react-dom';
import App from './App.tsx';
import Web3 from 'web3';

let web3 = new Web3(Web3.givenProvider || "ws://localhost:8545");

ReactDOM.render(
  <React.StrictMode>
    <App web3={web3} />
  </React.StrictMode>,
  document.getElementById('root')
);
